func (r *MoqListener_Addr_fnRecorder) FindResults() {
	r.Moq.Scene.T.Helper()
	if r.Results != nil {
		r.Results.Repeat.Increment(r.Moq.Scene.T)
		return
	}

	anyCount := bits.OnesCount64(r.AnyParams)
	insertAt := -1
	var results *MoqListener_Addr_resultsByParams
	for n, res := range r.Moq.ResultsByParams_Addr {
		if res.AnyParams == r.AnyParams {
			results = &res
			break
		}
		if res.AnyCount > anyCount {
			insertAt = n
		}
	}
	if results == nil {
		results = &MoqListener_Addr_resultsByParams{
			AnyCount:  anyCount,
			AnyParams: r.AnyParams,
			Results:   map[MoqListener_Addr_paramsKey]*MoqListener_Addr_results{},
		}
		r.Moq.ResultsByParams_Addr = append(r.Moq.ResultsByParams_Addr, *results)
		if insertAt != -1 && insertAt+1 < len(r.Moq.ResultsByParams_Addr) {
			copy(r.Moq.ResultsByParams_Addr[insertAt+1:], r.Moq.ResultsByParams_Addr[insertAt:0])
			r.Moq.ResultsByParams_Addr[insertAt] = *results
		}
	}

	paramsKey := r.Moq.ParamsKey_Addr(r.Params, r.AnyParams)

	var ok bool
	r.Results, ok = results.Results[paramsKey]
	if !ok {
		r.Results = &MoqListener_Addr_results{
			Params:  r.Params,
			Results: nil,
			Index:   0,
			Repeat:  &moq.RepeatVal{},
		}
		results.Results[paramsKey] = r.Results
	}

	r.Results.Repeat.Increment(r.Moq.Scene.T)
}

func (r *MoqListener_Addr_fnRecorder) Repeat(repeaters ...moq.Repeater) *MoqListener_Addr_fnRecorder {
	r.Moq.Scene.T.Helper()
	if r.Results == nil {
		r.Moq.Scene.T.Fatalf("ReturnResults or DoReturnResults must be called before calling Repeat")
		return nil
	}
	r.Results.Repeat.Repeat(r.Moq.Scene.T, repeaters)
	last := r.Results.Results[len(r.Results.Results)-1]
	for n := 0; n < r.Results.Repeat.ResultCount-1; n++ {
		if r.Sequence {
			last = struct {
				Values *struct {
					Result1 net.Addr
				}
				Sequence   uint32
				DoFn       MoqListener_Addr_doFn
				DoReturnFn MoqListener_Addr_doReturnFn
			}{
				Values:   last.Values,
				Sequence: r.Moq.Scene.NextRecorderSequence(),
			}
		}
		r.Results.Results = append(r.Results.Results, last)
	}
	return r
}

